import { fromJS } from "immutable";
import * as constants from "./constants";

const defaultState = fromJS({
  title: "遇鹿呈祥",
  content:"<img src='https://cdngarenanow-a.akamaihd.net/mgames/kgcenter/tw/client/GameData/Hero/20/skin/20171017062252-6055.jpg' /><p>疫情不退，囚家日久。寻无人之径，舒缓疲惫之心。旱热之季，蚊虫肆虐，湿地成无人区。架车慢游，遇鹿呈祥，可爱的小鹿，让心祥和。愿小鹿象家乡的白鹿，所到之处，万木茂盛、疫疠廓清，万家康乐。在佛罗里达, 迈阿密很难看到鹿。（Key Deer, native in South Florida)作者：白鹿鲸 链接：https://www.jianshu.com/p/e0819e89c177 来源：简书著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>",
});



export default (state = defaultState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
